import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Lol from './components/test.jsx'
import NavBar from './components/navbar.jsx'
import Table from './components/tables2.jsx'
import Search from './components/searchField.jsx'
import DropDown from './components/dropdownFilter.jsx'
import { Tabs, Tab } from 'react-bootstrap'
import './styles/git_stylesheet.css'
import './styles/git_stylesheet2.css'


import 'react-table/react-table.css'

class App extends Component {
  render() {


    let { title } = this.props;
    return (

      <div className="App">
        <header>

        </header>
        <NavBar/>

        <Tabs defaultActiveKey={2} id="uncontrolled-tab-example">
        <Tab eventKey={1} title="Code"/>
        <Tab eventKey={2} title="Issues">
        <div class="container new-discussion-timeline experiment-repo-nav  ">
        <div class="repository-content ">
          <div class="issues-listing js-check-all-container">

            <DropDown/><Search/>
            <div class="border-right border-bottom border-left" aria-label="Issues"role="group">
              <Table/>
              </div>
            </div>
          </div>
        </div>

        </Tab>
        <Tab eventKey={3} title="Pull Requests"/>
        <Tab eventKey={3} title="Projects"/>
        <Tab eventKey={3} title="Insights"/>

      </Tabs>

      </div>
    );
  }
}


App.defaultProps = {
  title: "TITRE"
};

export default App;
